// src/components/CourtDateTracking.js
import React from 'react';

const CourtDateTracking = () => {
    return (
        <div className="service-section">
            <h2>Court Date Tracking</h2>
            <div className="feature">
                <h3>Calendar Integration</h3>
                <p>Sync court dates and deadlines with your calendar for easy tracking and reminders.</p>
            </div>
            <div className="feature">
                <h3>Alerts and Notifications</h3>
                <p>Receive alerts and notifications for upcoming court dates and important deadlines.</p>
            </div>
            <div className="feature">
                <h3>Case History</h3>
                <p>View case history and past court dates to stay informed and prepared for upcoming hearings.</p>
            </div>
        </div>
    );
};

export default CourtDateTracking;
